import React from 'react';
import "./Topbar";
import { Button,Navbar,Nav,NavDropdown } from "react-bootstrap";
import "../../../node_modules/bootstrap/dist/css/bootstrap.min.css";


export default function topbar() {
  return (
    <div>
        <Navbar className="bg-secondary navbar-expand-sm">
          <a className="navbar-brand">
            Socialmedia App
          </a>
          <ul className="navbar-nav ml-auto">
            <li className="nav-item"><a href='#' className="nav-link">Homepage</a></li>
            <li className="nav-item"><a href='#' className="nav-link">Timeline</a></li>
          </ul>
          </Navbar>
        <NavDropdown className="bg-warning">Navbar dropdown</NavDropdown>
        this is Topbar
        <Button className="btn btn-danger">Topbar</Button>
        
    </div>
    
  );
};
